import axios from "axios"

const myUrl= 'http://localhost:4002/'
//הצטרפות של משתמש
export const AddUser = async(NewUser) =>{
    let newUserAdd =await axios.post(`${myUrl}user/HarshamaFrom`,NewUser) 
    console.log(newUserAdd.data);
    //שמירת הנהנתונים בקומפוננטה
    return newUserAdd.data;
  } 

  //בדיקה האם קיים
export const EnterUser= async(User) => {

